import React from "react"




 const MemberCard = ({match,data}) => {
  var member= data.find(p => p.id == match.params.memberId);
  var memberData;

  if(member)
    memberData = <div>
      <h3> {member.name} </h3>
      <p>{member.description}</p>
      <hr/>
      <h4>{member.status}</h4>  </div>;
  else
    memberData = <h2> Sorry. Member doesnt exist </h2>;

  return (
    <div>
      <div>
         {memberData}
      </div>
    </div>
  )    
}

export default MemberCard
